import React from 'react';

const About = () => {
  return (
    <div
      className="min-h-screen flex flex-col items-center justify-center text-center p-4"
      style={{
        backgroundImage:
          "url('https://picsum.photos/1600/900?grayscale')",
        backgroundSize: 'cover',
        backgroundPosition: 'center',
      }}
    >
      <div className="bg-black bg-opacity-60 rounded-xl p-8 max-w-2xl">
        <h1 className="text-4xl font-bold text-white">About Our Product App</h1>
        <p className="mt-4 text-gray-200 text-lg">
          This app allows you to easily manage your products with Add, Edit, and Delete 
          functionalities. It's built using React and Tailwind CSS for a sleek, clean, 
          and responsive design.
        </p>
      </div>
    </div>
  );
};

export default About;
